// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./Comptroller.sol";
import "./GoodLottery.sol";
import "./GoodInterface.sol";
import "./WishToken.sol";
import "./GoodLotteryNFT.sol";

contract WishProxy {
    Comptroller comptroller;

    struct UserPublishedGood {
        bool isList;
        uint32 goodId;
        uint256 goodValue;
        uint256 maintenanceFee;
        uint256 publishTime;
        uint256 lockedTime;
        string goodHash;
        address nftAddress;
        uint256 tokenId;
        uint256 status;
        address nft;
    }

    mapping(address => address[]) public userGoods;


    constructor(address payable _comptroller) {
        comptroller = Comptroller(_comptroller);
    }

    function addGoods(address user, address good) public {
        userGoods[user].push(good);
    }

    function getUserPublishedGoods(address account)
        public
        view
        returns (UserPublishedGood[] memory)
    {
        address[] memory goods = userGoods[account];

        UserPublishedGood[] memory records = new UserPublishedGood[](
            goods.length
        );

        for (uint256 i = 0; i < goods.length; i++) {
            GoodLotteryNFT nft = GoodLotteryNFT(goods[i]);
            UserPublishedGood memory record = UserPublishedGood({
                isList: true,
                goodId: nft.goodId(),
                goodValue: nft.goodValue(),
                maintenanceFee: nft.maintenanceFee(),
                publishTime: nft.publishTime(),
                lockedTime: nft.lockedTime(),
                goodHash: nft.goodHash(),
                nftAddress: address(nft.nftToken()),
                tokenId: nft.tokenId(),
                status: 0,
                nft: goods[i]
            });
            if (comptroller.goodIsList(record.goodId, goods[i])) {
                record.status = 1;
            } else if (nft.isApproved()) {
                record.status = 2;
            } else {
                record.status = 3;
            }

            records[i] = record;
        }
        return records;
    }
}
